import { Component } from "react";

class Demo9_CB_Func_Child extends Component
{
    constructor(props)
    {
        super(props)
    }

    sendDataToParent = (e) =>
    {
        this.props.callback(e.target.value)
    }

    render()
    {
        return (<div style={{border:"2px solid orange", backgroundColor:"lightgoldenrodyellow", width:"200px"}}>

                <h3>Demo9 CB-Func_Child</h3>
                Send to Parent <input type="text" onChange={this.sendDataToParent}/>

        </div>)
    }
}

export default Demo9_CB_Func_Child;
